		var alreadyGeneratedPara = [];
		var alreadyGeneratedWords = [];
		var allAssignedParaLength = [];
		function generateResult()
		{
			var numbers = document.getElementById("parawords").value;
			var selectedOption = document.querySelector('input[name="paraorword"]:checked');
			if(numbers == "")
			{
				document.getElementById("error").innerHTML = "";
				document.getElementById("error").innerHTML = "Please enter a number.";
				document.getElementById("parawords").focus();
				return false;
			}
			else if(isNaN(numbers))
			{
				document.getElementById("error").innerHTML = "";
				document.getElementById("error").innerHTML = "Please enter numbers only.";
				document.getElementById("parawords").focus();
				return false;
			}
			else if(numbers < 1)
			{
				document.getElementById("error").innerHTML = "";
				document.getElementById("error").innerHTML = "Please enter a non-zero value.";
				document.getElementById("parawords").focus();
				return false;
			}
			else if(selectedOption == null)
			{
				document.getElementById("error").innerHTML = "";
				document.getElementById("error").innerHTML = "Please select an option from paragraphs or words.";
				document.getElementById("paraorword").focus();
				return false;
			}
			else
			{
				alreadyGeneratedPara = [];
				alreadyGeneratedWords = [];
				document.getElementById("error").innerHTML = "";
				document.getElementById("results").innerHTML = "";
				var selectedValue = selectedOption.value;
				if(selectedValue == "paragraphs")
				{
                    if(numbers > 100){
                        numbers = 100;
                        document.getElementById("error").innerHTML = "The maximum number of paragraphs is 100.";
                    }
					alreadyGeneratedPara.push(loremipsum[0]);
					var remainParagraphs = numbers - 1;
					while(alreadyGeneratedPara.length != numbers)
					{
						var randomPara = loremipsum[Math.floor(Math.random() * loremipsum.length)];
						if(alreadyGeneratedPara.indexOf(randomPara) === -1)
						{
							alreadyGeneratedPara.push(randomPara);
						}
					}
					for(var r = 0; r < alreadyGeneratedPara.length; r++)
					{
						document.getElementById("results").innerHTML += "<p>"+alreadyGeneratedPara[r]+"</p>";
					}
				}
				else if(selectedValue == "words")
				{
                    if(numbers > 10000){
                        numbers = 10000;
                        document.getElementById("error").innerHTML = "The maximum number of words is 10000.";
                    }
					var c = 0;
					var i = 0;
					var firstParaWords = loremipsum[c].split(" ");
					allAssignedParaLength.push(firstParaWords.length);
					if(numbers > firstParaWords.length)
					{
						document.getElementById("results").innerHTML = "";
						document.getElementById("results").innerHTML += "<p>";
						while(alreadyGeneratedWords.length != numbers)
						{
							alreadyGeneratedWords.push(firstParaWords[i]);
							document.getElementById("results").innerHTML += firstParaWords[i]+" ";
							i++;
							if(i >= firstParaWords.length)
							{
								c++;
								document.getElementById("results").innerHTML += "</p>";
								document.getElementById("results").innerHTML += "<p>";
								var nextParaWords = loremipsum[c].split(" ");
								allAssignedParaLength.push(nextParaWords.length);
								for(var p = 0; p < nextParaWords.length; p++)
								{
									if(i < numbers)
									{
										document.getElementById("results").innerHTML += nextParaWords[p]+" ";
										alreadyGeneratedWords.push(nextParaWords[p]);
										i++;
									}
								}
							}
						}
					}
					else
					{
						if(c == 0)
						{
							document.getElementById("results").innerHTML += "<p>";
							for(var w = 0; w < numbers; w++)
							for(var w = 0; w < numbers; w++)
							{
								if(w != numbers-1)
									document.getElementById("results").innerHTML += firstParaWords[w]+" ";
								else if(w == numbers-1)
									document.getElementById("results").innerHTML += firstParaWords[w];
							}
							document.getElementById("results").innerHTML += "</p>";
						}						
					}
					c = 0;
					i = 0;
				}
			}
		}
